import css from './Calculator.module.css';

export const Calculator = ({
  value,
  currency,
  onChangeValue,
  onChangeCurrency,
}) => {
  return (
    <>
      <input
        onChange={e => onChangeValue(e.target.value)}
        value={value}
        type="number"
      />
      <input />
    </>
  );
};
export default Calculator;
